    <h3>О КОМПАНИИ</h3>

    <div class="top">
      <div class="left">
        Мы <span>профессионально</span>
        занимаемся <span>закупкой товаров</span>
        у зарубежных поставщиков и их <span>доставкой</span> в Россию
      </div>
      <div class="right">
        <p>
          Европейская Торговая Компания была основана в 2022 году в городе Калининград.
          Коллектив компании состоит из специалистов с успешным опытом работы в сфере
          международных перевозок, таможенного оформления и внешнеэкономической деятельности.
        </p>
        <p>
          Предоставляем клиенту возможности сконцентрироваться на основной деятельности
          не затрачивая ресурсы и время на изучение законодательств, организацию и контроль поставки,
          ведение отчётности по финансовым операциям при международной торговле,
          сбор сопроводительной документации, сертификацию товара и т.д.
        </p>
